function ElementSpawnEnemyDummy:init(...)
	ElementSpawnEnemyDummy.super.init(self, ...)
	local ai_type = tweak_data.levels:get_ai_group_type()
    local difficulty = Global.game_settings and Global.game_settings.difficulty or "normal"
    local difficulty_index = tweak_data:difficulty_to_index(difficulty)
	local level = Global.level_data and Global.level_data.level_id
	
	if ai_type == "america" then
		if level == "pbr" or level == "pbr2" or level == "shoutout_raid" then
			if difficulty_index == 2 or difficulty_index == 3 then
				if police_and_murkywater[self._values.enemy] then
					self._values.enemy = police_and_murkywater[self._values.enemy]
				end
				self._values.enemy = police_and_murkywater[self._values.enemy] or self._values.enemy
			elseif difficulty_index == 4 or difficulty_index == 5 then
				if fbi_and_murkywater[self._values.enemy] then
					self._values.enemy = fbi_and_murkywater[self._values.enemy]
				end
				self._values.enemy = fbi_and_murkywater[self._values.enemy] or self._values.enemy
			elseif difficulty_index == 6 or difficulty_index == 7 then
				if gensec_and_murkywater[self._values.enemy] then
					self._values.enemy = gensec_and_murkywater[self._values.enemy]
				end
				self._values.enemy = gensec_and_murkywater[self._values.enemy] or self._values.enemy
			elseif difficulty_index == 8 then
				if dhs_and_murkywater[self._values.enemy] then
					self._values.enemy = dhs_and_murkywater[self._values.enemy]
				end
				self._values.enemy = dhs_and_murkywater[self._values.enemy] or self._values.enemy
			end
		end
		if level == "alex_3" then
			if difficulty_index == 2 or difficulty_index == 3 or difficulty_index == 4 or difficulty_index == 5 or difficulty_index == 6 or difficulty_index == 7 or difficulty_index == 8 then
				if rats_agents[self._values.enemy] then
					self._values.enemy = rats_agents[self._values.enemy]
				end
				self._values.enemy = rats_agents[self._values.enemy] or self._values.enemy	
			end
		end
		if level ~= "firestarter_2" or level ~= "alex_3" or level ~= "pbr" or level ~= "pbr2" or level ~= "shoutout_raid" then
			if difficulty_index == 2 or difficulty_index == 3 then
				if police[self._values.enemy] then
					self._values.enemy = police[self._values.enemy]
				end
				self._values.enemy = police[self._values.enemy] or self._values.enemy
			elseif difficulty_index == 4 or difficulty_index == 5 then
				if fbi[self._values.enemy] then
					self._values.enemy = fbi[self._values.enemy]
				end
				self._values.enemy = fbi[self._values.enemy] or self._values.enemy
			elseif difficulty_index == 6 or difficulty_index == 7 then
				if gensec[self._values.enemy] then
					self._values.enemy = gensec[self._values.enemy]
				end
				self._values.enemy = gensec[self._values.enemy] or self._values.enemy
			elseif difficulty_index == 8 then
				if dhs[self._values.enemy] then
					self._values.enemy = dhs[self._values.enemy]
				end
				self._values.enemy = dhs[self._values.enemy] or self._values.enemy
			end
		end
	self._enemy_name = self._values.enemy and Idstring(self._values.enemy) or Idstring("units/payday2/characters/ene_swat_1/ene_swat_1")
	self._values.enemy = nil
	self._units = {}
	self._events = {}
	self:_finalize_values()
	elseif ai_type == "zombie" then
		if difficulty_index == 2 or difficulty_index == 3 then
			if zombie_police[self._values.enemy] then
				self._values.enemy = zombie_police[self._values.enemy]
			end
			self._values.enemy = zombie_police[self._values.enemy] or self._values.enemy
		elseif difficulty_index == 4 or difficulty_index == 5 then
			if zombie_fbi[self._values.enemy] then
				self._values.enemy = zombie_fbi[self._values.enemy]
			end
			self._values.enemy = zombie_fbi[self._values.enemy] or self._values.enemy
		elseif difficulty_index == 6 or difficulty_index == 7 or difficulty_index == 8 then
			if zombie_gensec_dhs[self._values.enemy] then
				self._values.enemy = zombie_gensec_dhs[self._values.enemy]
			end
			self._values.enemy = zombie_gensec_dhs[self._values.enemy] or self._values.enemy
		end
	self._enemy_name = self._values.enemy and Idstring(self._values.enemy) or Idstring("units/payday2/characters/ene_swat_1/ene_swat_1")
	self._values.enemy = nil
	self._units = {}
	self._events = {}
	self:_finalize_values()
	end
